import "./styles.css";
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import Home from './home';

function App() {
  return (
    <div className="App">

      <BrowserRouter>
      <Routes>
        <Route path={"/"} element = {<Home />}></Route>
      </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
